const items = $input.all();

if (items.length === 0) {
  return [{
    json: {
      error: true,
      patient_id: $('Webhook').first().json.patient_id,
      html: `<!DOCTYPE html><html><head><meta charset="UTF-8"><title>Patient Not Found</title><style>body{font-family:sans-serif;display:flex;justify-content:center;align-items:center;min-height:100vh;margin:0;background:linear-gradient(135deg,#667eea 0%,#764ba2 100%)}.error-container{background:white;padding:3rem;border-radius:12px;box-shadow:0 20px 60px rgba(0,0,0,0.3);text-align:center;max-width:500px}.error-icon{font-size:4rem;margin-bottom:1rem}h1{color:#e53e3e;margin:0 0 1rem 0}p{color:#4a5568;margin:0.5rem 0}</style></head><body><div class="error-container"><div class="error-icon">üîç</div><h1>Patient Not Found</h1><p>No patient record exists for ID: ${$('Webhook').first().json.patient_id}</p></div></body></html>`
    }
  }];
}

const patient = items[0].json;
const safeNum = (val, def = 0) => { const n = parseFloat(val); return isNaN(n) ? def : n; };
const safeInt = (val, def = 0) => { const n = parseInt(val); return isNaN(n) ? def : n; };

const glucose = safeNum(patient.glucose);
const bmi = safeNum(patient.bmi);
const heartRate = safeInt(patient.heart_rate);
const systolic = safeInt(patient.systolic_bp);
const diastolic = safeInt(patient.diastolic_bp);

let bmiCategory = "Unknown", bmiColor = "#718096";
if (bmi > 0) {
  if (bmi < 18.5) { bmiCategory = "Underweight"; bmiColor = "#f6ad55"; }
  else if (bmi < 25) { bmiCategory = "Normal"; bmiColor = "#48bb78"; }
  else if (bmi < 30) { bmiCategory = "Overweight"; bmiColor = "#ed8936"; }
  else { bmiCategory = "Obese"; bmiColor = "#e53e3e"; }
}

let bpStatus = "Unknown", bpColor = "#718096";
if (systolic > 0 && diastolic > 0) {
  if (systolic >= 140 || diastolic >= 90) { bpStatus = "Hypertension Stage 2"; bpColor = "#c53030"; }
  else if (systolic >= 130 || diastolic >= 80) { bpStatus = "Hypertension Stage 1"; bpColor = "#e53e3e"; }
  else if (systolic >= 120 && systolic < 130 && diastolic < 80) { bpStatus = "Elevated"; bpColor = "#ed8936"; }
  else { bpStatus = "Normal"; bpColor = "#48bb78"; }
}

let glucoseZone = "Unknown", glucoseColor = "#718096";
if (glucose > 0) {
  if (glucose >= 125) { glucoseZone = "Diabetic"; glucoseColor = "#e53e3e"; }
  else if (glucose >= 100) { glucoseZone = "Prediabetic"; glucoseColor = "#ed8936"; }
  else { glucoseZone = "Normal"; glucoseColor = "#48bb78"; }
}

let hrStatus = "Unknown", hrColor = "#718096";
if (heartRate > 0) {
  if (heartRate < 60) { hrStatus = "Low"; hrColor = "#4299e1"; }
  else if (heartRate <= 100) { hrStatus = "Normal"; hrColor = "#48bb78"; }
  else if (heartRate <= 120) { hrStatus = "Elevated"; hrColor = "#ed8936"; }
  else { hrStatus = "High"; hrColor = "#e53e3e"; }
}

return [{
  json: {
    error: false,
    id: patient.id,
    name: patient.name || "Unknown",
    age: safeInt(patient.age),
    gender: patient.gender || "Unknown",
    contact: patient.contact || "N/A",
    mail: patient.mail || "N/A",
    condition_type: patient.condition_type || "Unknown",
    assigned_doctor: patient.assigned_doctor || "Unassigned",
    status: patient.status || "Unknown",
    glucose, bmi, heart_rate: heartRate, systolic_bp: systolic, diastolic_bp: diastolic,
    insulin: safeNum(patient.insulin),
    blood_sugar: safeNum(patient.blood_sugar),
    ck_mb: safeNum(patient.ck_mb),
    troponin: safeNum(patient.troponin),
    visit_date_formatted: patient.visit_date_formatted || "N/A",
    next_followup_formatted: patient.next_followup_formatted || "N/A",
    bmi_category: bmiCategory, bmi_color: bmiColor,
    bp_status: bpStatus, bp_color: bpColor,
    glucose_zone: glucoseZone, glucose_color: glucoseColor,
    hr_status: hrStatus, hr_color: hrColor
  }
}];

const item = $input.all()[0].json;
const enc = (cfg) => `https://quickchart.io/chart?c=${encodeURIComponent(JSON.stringify(cfg))}&width=400&height=300`;

item.glucoseChartUrl = enc({
  type: 'doughnut',
  data: { datasets: [{ data: [item.glucose ?? 100, 200 - (item.glucose ?? 100)], backgroundColor: [item.glucose_color ?? '#48bb78', '#e2e8f0'], borderWidth: 0 }] },
  options: { rotation: 270, circumference: 180, cutout: '80%', plugins: { legend: { display: false }, title: { display: true, text: `Glucose: ${item.glucose ?? 100} mg/dL - ${item.glucose_zone ?? 'Normal'}`, font: { size: 18 } } } }
});

item.bpChartUrl = enc({
  type: 'bar',
  data: { labels: ['Systolic', 'Diastolic'], datasets: [{ data: [item.systolic_bp ?? 120, item.diastolic_bp ?? 80], backgroundColor: [item.bp_color ?? '#60a5fa', '#93c5fd'] }] },
  options: { plugins: { legend: { display: false }, title: { display: true, text: `BP: ${item.systolic_bp ?? 120}/${item.diastolic_bp ?? 80} - ${item.bp_status ?? 'Normal'}`, font: { size: 18 } } }, scales: { y: { beginAtZero: true, max: 200 } } }
