item.hrChartUrl = enc({
  type: 'doughnut',
  data: { datasets: [{ data: [item.heart_rate ?? 70, 200 - (item.heart_rate ?? 70)], backgroundColor: ['#f472b6', '#fce7f3'], borderWidth: 0 }] },
  options: { rotation: 270, circumference: 180, cutout: '80%', plugins: { legend: { display: false }, title: { display: true, text: `Heart Rate: ${item.heart_rate ?? 70} bpm`, font: { size: 18 } } } }
});

item.bmiChartUrl = enc({
  type: 'doughnut',
  data: { datasets: [{ data: [item.bmi ?? 22, 40 - (item.bmi ?? 22)], backgroundColor: [item.bmi_color ?? '#a78bfa', '#ede9fe'], borderWidth: 0 }] },
  options: { rotation: 270, circumference: 180, cutout: '80%', plugins: { legend: { display: false }, title: { display: true, text: `BMI: ${item.bmi ?? 22} - ${item.bmi_category ?? 'Normal'}`, font: { size: 18 } } } }
});

return item;

